function lockaxis(axi){
if(axi=="x"){
setVelX(getPlayerEnt(), 0);
}
if(axi=="y"){
setVelY(getPlayerEnt(), 0);
}
if(axi=="z"){
setVelY(getPlayerEnt(), 0);
}
}
