function roundPart(part,x,y,z,diameter,size,velX,velY,velZ){
diameter = diameter/2;
if(!velX){velX=0;}
if(!velY){velY=0;}
if(!velZ){velZ=0;}
for(var i=0;i<2*(Math.PI*diameter);i = i + 0.1){
Level.addParticle(part,x+0.5+Math.sin(i)*diameter,y,z+0.5+Math.cos(i)*diameter,velX,velY,velZ,size)
}
}
