function fileTxt(filePath) {
var file=new java.io.File(filePath);
var fos=new java.io.FileInputStream(file);
var str=new java.lang.StringBuilder();
var ch;
while((ch=fos.read())!=-1)
str.append(java.lang.Character(ch));
var txt=String(str.toString());
return txt;
}
